description:
Agathe organizes home dinner with friends involving Jennifer, Sandrine and Lise. At the same time, Jean-Philippe gets home Seb, Franck, and Bertrand. The film traces the evening during which the two groups, men on one side, women on the other, come to talk about sex and illustrate their statements by the experiences narrative. Each tells his own version of events, often totally different perception of their partner.(Google translation..)

